import * as React from "react";
import Container from "@mui/material/Container";
import AppBar from "@mui/material/AppBar";
import Box from "@mui/material/Box";
import Toolbar from "@mui/material/Toolbar";
import Typography from "@mui/material/Typography";
import DatePicker from "react-datepicker";
import datePicker from "./navbar.module.css";

export default function ButtonAppBar({
  setAPODStartDate,
  setAPODEndDate,
  setAPOD,
  startDate,
  endDate,
}) {
  const SelectStartDate = () => {
    const selectNewStartDate = (date) => {
      setAPODStartDate(date);
      setAPOD([]);
    };

    const selectNewEndDate = (date) => {
      setAPODEndDate(date);
      setAPOD([]);
    };

    return (
      <div style={{float: "left"}}>
        <p>Start Date</p>
        <div style={{float: "left"}}>

          <DatePicker
            selected={startDate}
            onChange={(date) => selectNewStartDate(date)}
          />
        </div>
        <div style={{float: "left"}}>
          <DatePicker
            selected={endDate}
            onChange={(date) => selectNewEndDate(date)}
          />
        </div>
      </div>
    );
  };

  return (
    <AppBar position="static">
      <Container maxWidth="xl">
        <Toolbar disableGutters>
          <Typography
            variant="h6"
            noWrap
            component="div"
            sx={{ mr: 2, display: { xs: "none", md: "flex" } }}
          >
            Spacestagram
          </Typography>


          <Box sx={{ flexGrow: 0 }}>{SelectStartDate()}</Box>
        </Toolbar>
      </Container>
    </AppBar>
  );
}
